import React, { useEffect, useState } from 'react';
import { Helmet } from "react-helmet";
import { Text } from "../../components/Text/Text.jsx";
import bookImage from "../../assets/book.png";

export default function SavedPage() {
  const [savedFiles, setSavedFiles] = useState([]);

  useEffect(() => {
    const fetchSavedFiles = async () => {
      const response = await fetch("http://127.0.0.1:8000/api/upload-template/", {
        method: "GET",
        headers: {
          "Authorization": `Token ${token}`
        }
      });

      if (!response.ok) {
        throw new Error('Failed to fetch saved files');
      }

      const data = await response.json();
      setSavedFiles(data);
    };

    fetchSavedFiles();
  }, []);

  return (
    <>
      <Helmet>
        <title>criticowl</title>
        <meta name="description" content="Web site created using create-react-app" />
      </Helmet>
      <div className="flex w-full flex-col items-start gap-7 md:pb-5 p-5">
        <Text size="md" as="p" className="mb-5">
          Saved
        </Text>
        <div className="flex flex-col gap-[33px] w-full">
          {savedFiles.map(file => (
            <div key={file.id} className="flex flex-col items-start gap-5">
              <img src={bookImage} alt="image" className="h-[134px] w-auto" />
              <Text size="xs" as="p">
                {file.file}
              </Text>
              <a href={file.file} download>Download</a>
            </div>
          ))}
        </div>
      </div>
    </>
  );
}
